import { useState } from "react"

const Edit = (props) => {
    const [note, setNote] = useState("dd")
    function notechange(e) {
        setNote(e.target.value)
    }
    function addItem() {
        props.add([1, 2])
    }

    return <div>
        <h1>Note</h1>
        <p>write:</p>
        <input type='test' value={note} onChange={notechange} />
        <p>date:</p>
        <input type='date' />
        <p>time:</p>
        <input type='time' />
        <button className="add" onClick={addItem} >new</button>
    </div>
}

export default Edit
